  "id_str" : "11231076813",
  "text" : "\uD64D\uC218\uAC00 \uC790\uC8FC \uB098\uB294 \uAD6C\uAC04\uC5D0 \uBD80\uB4DD\uBD88 \uB451\uC744 \uB192\uC774 \uC313\uC744 \uC77C\uC774 \uC544\uB2C8\uB2E4. \uD64D\uC218\uAC00 \uC790\uC8FC \uB098\uB294 \uACF3\uC740 \uC790\uC5F0\uC2B5\uC9C0\uAC00 \uBC29\uD30C\uC81C \uC5ED\uD560\uACFC \uC0DD\uD0DC\uACC4 \uBCF4\uACE0\uC758 \uC5ED\uD560\uC744 \uAC19\uC774 \uD558\uB3C4\uB85D \uC6D0\uB798 \uC124\uACC4\uB418\uC5B4 \uC788\uB358\uAC70\uB2E4. \uADF8\uAC78 \uB451\uC744 \uC313\uACE0 \uC0AC\uB78C\uC774 \uC0B4\uACA0\uB2E4\uACE0 \uC544\uC6C5\uB2E4\uC6C5 \uAC70\uB9AC\uB2C8 \uD64D\uC218\uAC00 \uD574\uACB0\uC774 \uC548\uB418\uB294\uAC70\uB2E4.",
