  "text" : "\uD648\uD398\uC774\uC9C0\uC5D0 \uAC1C\uC778\uC815\uBCF4 \uAC00\uB4DD \uC313\uC544\uB193\uACE0 \uC8FD\uC5B4\uB77C \uB2F4\uC7A5\uC744 \uB192\uC5EC\uBD10\uC57C \uBCF4\uC548\uC774 \uB420 \uD131\uC774 \uC5C6\uB2E4. \uC560\uC2DC\uB2F9\uCD08 \uBCF4\uC548\uC740 \uC2E0\uAE30\uB8E8\uB098 \uB9C8\uCC2C\uAC00\uC9C0\uB2E4. \uC9C0\uCF1C\uC57C \uD560 \uAC83\uC774 \uC5C6\uB2E4\uBA74 \uBCF4\uC548\uB3C4 \uD544\uC694\uC5C6\uB294 \uAC83.. \uC811\uADFC \uBC29\uBC95 \uC790\uCCB4\uAC00 \uAE00\uB800\uB2E4.",
