  "text" : "\uC6B0\uB9AC \uB098\uB77C\uC758 \uC561\uD2F0\uBE0C\uC5D1\uC2A4 \uBB38\uC81C\uB294 \uC560\uC2DC\uB2F9\uCD08 \uC6F9\uD45C\uC900\uC774\uB098 \uAE30\uC220\uC801\uC778 \uBB38\uC81C\uB294 \uBD80\uCC28\uC801\uC778\uAC83\uC5D0 \uBD88\uACFC\uD558\uB2E4. \uB354 \uD070 \uBB38\uC81C\uB294 \uC2E0\uC6A9\uACFC \uC2E0\uB8B0\uAC00 \uC5C6\uB294 \uC0AC\uD68C \uC790\uCCB4\uAC00 \uBB38\uC81C\uB2E4. \uC774\uAC83\uB4E4\uC740 \uADFC\uBCF8\uC6D0\uC778\uC774 \uC5B4\uB514 \uC788\uB294\uC9C0 \uAD00\uC2EC\uC5C6\uACE0 \uC9C0\uAE08 \uB2F9\uC7A5\uC758 \uB55C\uBC29\uC5D0\uB9CC \uD608\uC548\uC774 \uB418\uC5B4 \uC788\uB2E4.",
