  "text" : "QA, \uAC1C\uBC1C, \uD14C\uC2A4\uD2B8, \uB514\uC790\uC778\uACFC \uAC19\uC740 \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uAC1C\uBC1C\uC758 \uBD84\uC5C5\uD654\uC640 \uC804\uBB38\uD654\uB294 \uC77C\uACAC \uC88B\uC544\uBCF4\uC774\uACE0 \uD0C0\uB2F9\uD574 \uBCF4\uC774\uC9C0\uB9CC \uC885\uAD6D\uC5D0\uB294 \uC815\uBCF4\uC758 \uB2E8\uC808\uB85C \uB0A9\uAE30\uC9C0\uC5F0, \uD488\uC9C8\uC800\uD558\uC640 \uAC19\uC740 \uBC18\uC791\uC6A9\uC774 \uC628\uB2E4. \uC774\uAC83\uC5D0 \uB300\uD55C \uADF9\uBCF5\uC5D0\uB294 TQC\uC640 \uAC19\uC740 \uC811\uADFC\uBC95\uC774 \uC720\uD6A8\uD560 \uC218 \uC788\uB2E4.",
