  "text" : "\uCC9C\uC548\uD568 \uC0AC\uD0DC\uB294 \uAC00\uC2B4 \uC544\uD508 \uC77C\uC774\uC9C0\uB9CC \uC774 \uC0AC\uAC74\uC774 \uD655\uB300 \uC7AC\uC0DD\uC0B0\uB418\uB294 \uAC83\uC740 \uC9C0\uBC29\uC120\uAC70\uC640 \uAC01\uC885 \uAD6D\uC815 \uC774\uC288\uB97C \uBB3C\uD0C0\uAE30 \uD558\uC5EC \uD544\uC2B9\uC758 \uC804\uB7B5\uC73C\uB85C \uC2B9\uB9AC\uD558\uACE0\uC790 \uD558\uB294 \uAE30\uB4DD\uAD8C \uC138\uB825\uC758 \uC120\uAC70 \uCC45\uB7B5\uC5D0 \uB3D9\uC870\uD558\uB294 \uAC83\uC740 \uC544\uB2CC\uC9C0 \uAC71\uC815\uC774\uB2E4. \uC6EC\uC9C0 \uC774 \uC77C\uC774 \uB370\uC7C8\uBDF0\uCC98\uB7FC \uB290\uAEF4\uC9C4\uB2E4.",
