  "text" : "\uCC9C\uC548\uD568 \uC0AC\uD0DC\uB85C \uAC00\uB729\uC774\uB098 \uACBD\uC9C1\uB41C \uB300\uBD81 \uAD00\uACC4\uC5D0 \uC545\uC601\uD5A5\uC774 \uC0DD\uAE30\uACE0 \uD55C\uBA85\uC219 \uC804 \uCD1D\uB9AC, 4\uB300\uAC15, \uC138\uC885\uC2DC, \uC9C0\uBC29 \uC120\uAC70 \uB4F1 \uAC01\uC885 \uC774\uC288\uB4E4\uC774 \uC2F8\uADF8\uB9AC \uBB3C\uD0C0\uAE30 \uB418\uC5B4 \uC6B0\uB9AC\uAC00 \uBAA8\uB974\uB294 \uC0AC\uC774\uC5D0 \uBAA8\uC870\uB9AC \uD55C\uBC29\uC5D0 \uD574\uACB0\uB418\uC5B4 \uBC84\uB9AC\uBA74 \uC5BC\uB9C8\uB098 \uD5C8\uD0C8\uD560\uAE4C? \uC815\uC2E0 \uCC28\uB9AC\uACE0 \uB098\uB2C8 \uC774\uBBF8 \uC0C1\uD669\uC885\uACB0..",
