  "text" : "\uC5EC\uB7EC\uB300\uC758 \uCC28\uB7C9\uC5D0 \uB098\uB220\uD0C0\uACE0 \uBAA9\uC801\uC9C0\uB85C \uAC08 \uACBD\uC6B0 \uC0C1\uB300\uBC29\uC774 \uC9C0\uAE08 \uC798 \uB530\uB77C\uC624\uACE0 \uC788\uB294\uC9C0 \uB108\uBB34 \uAD81\uAE08\uD560\uB54C \uB124\uBE44\uAC8C\uC774\uC158\uC5D0 \uB3D9\uD589\uD558\uB294 \uCC28\uB7C9\uC774 \uD568\uAED8 \uD45C\uC2DC\uB418\uB294 \uADF8\uB7F0 \uC11C\uBE44\uC2A4\uAC00 \uC788\uC5C8\uC73C\uBA74 \uC88B\uACA0\uB2E4. \uC2A4\uB9C8\uD2B8\uD3F0\uC73C\uB85C\uB3C4 \uADF8\uB7F0 \uC11C\uBE44\uC2A4\uB294 \uC27D\uAC8C \uAD6C\uD604\uD560 \uC218 \uC788\uC744 \uAC70 \uAC19\uC740\uB370..",
