  "text" : "PC\uC640 \uCF58\uC194\uC5D0 \uAC07\uD600 \uC788\uB358 \uAC8C\uC784\uC774 \uC11C\uC11C\uD788 \uC138\uC0C1\uC18D\uC73C\uB85C \uD30C\uACE0 \uB4E4\uACE0 \uC788\uB2E4. \uD604\uC2E4\uACFC \uAC8C\uC784\uC758 \uACBD\uACC4\uAC00 \uC810\uC810 \uD76C\uBBF8\uD574\uC9C0\uACE0 \uC788\uB2E4. \uD3EC\uC2A4\uD018\uC5B4\uB294 \uC704\uCE58\uAE30\uBC18 SNS \uC11C\uBE44\uC2A4\uC774\uBA74\uC11C \uAC8C\uC784\uC774\uAE30\uB3C4 \uD558\uB2E4. \uC774\uB7EC\uB2E4 \uC77C\uC0C1\uC774 \uAC8C\uC784\uC774 \uB418\uACE0 \uAC8C\uC784\uC774 \uC77C\uC0C1\uC774\uB418\uB294 \uC138\uC0C1\uC774 \uC628\uB2E4\uBA74?",
