  "text" : "\uAC1C\uBC1C \uBB38\uC11C \uAC31\uC2E0\uC728\uACFC \uC694\uAD6C\uC0AC\uD56D \uBCC0\uACBD\uC728\uC740 \uBC18\uBE44\uB840\uD55C\uB2E4. \uC694\uAD6C\uC0AC\uD56D\uC774 \uC790\uC8FC \uBCC0\uACBD\uB420 \uC218\uB85D \uAC1C\uBC1C\uBB38\uC11C\uB294 \uC810\uC810 \uC78A\uD600\uC9C4\uB2E4. \uD2B9\uD788 \uC815\uBCF4\uAC00 \uC720\uD1B5\uB418\uC9C0 \uC54A\uACE0 \uC74C\uC9C0\uC5D0\uC11C \uBCC0\uACBD\uB418\uB294 \uC694\uAD6C\uC0AC\uD56D\uC774 \uB9CE\uC544\uC9C8 \uC218\uB85D \uBB38\uC11C\uD654\uB294 \uC810\uC810 \uC801\uC5B4\uC9C4\uB2E4. \uACB0\uAD6D \uD504\uB85C\uC81D\uD2B8\uB294 \uB9DD\uD55C\uB2E4",
