  "text" : "\uAC1C\uBC1C\uBB38\uC11C \uAC31\uC2E0\uC728\uACFC \uD14C\uC2A4\uD2B8\uC758 \uC644\uC131\uB3C4 \uC5ED\uC2DC \uBC18\uBE44\uB840\uB2E4. \uAC1C\uBC1C\uBB38\uC11C\uAC00 \uC5C6\uB294 \uD14C\uC2A4\uD2B8\uB294 \uC2E0\uB8B0\uB3C4\uAC00 \uB192\uC9C0 \uC54A\uB2E4. \uACB0\uD568\uBC1C\uACAC\uC728\uB3C4 \uB0AE\uB2E4. \uACB0\uAD6D \uACB0\uD568\uD22C\uC131\uC774 \uC81C\uD488\uC774 \uB9CC\uB4E4\uC5B4\uC9C8 \uC218\uBC16\uC5D0 \uC5C6\uB2E4. \uBB38\uC11C\uB294 \uADF8\uC800 \uAC00\uBCBC\uC6B4\uAC8C \uC9C4\uB9AC\uAC00 \uC544\uB2D0\uAE4C?",
