  "text" : "\uAC04\uB2E8\uD558\uAC8C \uAC04\uB7B5\uD558\uAC8C\uC758 \uC9C4\uC2E4\uC740 \uD575\uC2EC\uB9CC\uC744 \uCC3E\uC73C\uB77C\uB294 \uAC83\uC774\uB2E4. \uBB34\uC131\uD55C \uB098\uBB34\uAC00\uC9C0\uB97C \uC544\uBB34\uB807\uAC8C\uB098 \uC790\uB978\uB2E4\uACE0 \uC774\uC05C \uC815\uC6D0\uC218\uAC00 \uB418\uC9C0\uB294 \uC54A\uB294\uB2E4. \uC774\uC05C \uC815\uC6D0\uC218\uAC00 \uB418\uAE30 \uC704\uD574\uC11C\uB294 \uC804\uBB38\uC801\uC778 \uC815\uC6D0\uC0AC\uC640 \uAE30\uC220\uC774 \uD544\uC694\uD558\uB2E4. \uBB38\uC11C\uB97C \uC798 \uB9CC\uB4DC\uB294 \uAC83\uB3C4 \uAE30\uC220\uC774\uB2E4. \uB09C \uADF8\uB7F0 \uAE30\uC220\uC774 \uD615\uD3B8\uC5C6\uB2E4.\u3160\u3160",
