  "text" : "\uC800\uB294 \uC0AC\uC2E4 \uD14C\uC2A4\uD305\uC744 \uC798 \uC54C\uC9C0 \uBABB\uD569\uB2C8\uB2E4. \uD2B9\uD788 \uD14C\uC2A4\uD305\uC744 \uC5B4\uB5BB\uAC8C \uD558\uB290\uB0D0\uC5D0 \uB300\uD55C \uBB3C\uC74C\uC5D0\uB294 \uAC70\uC758 \uC950\uC57D\uC785\uB2C8\uB2E4. \uD551\uACC4\uB97C \uB304\uB2E4\uBA74 \uD14C\uC2A4\uD305\uC744 \uC5B4\uB5BB\uAC8C \uD558\uB290\uB0D0\uB294 \uC815\uD669\uACFC \uC0C1\uD669\uC5D0 \uB530\uB77C \uCC9C\uCC28\uB9CC\uBCC4\uC774\uAE30 \uB54C\uBB38\uC785\uB2C8\uB2E4. \uC774 \uC138\uC0C1\uC758 \uC218\uB9CE\uC740 \uC18C\uD504\uD2B8\uC6E8\uC5B4\uC640 \uC790\uB3D9\uD654 \uB3C4\uAD6C\uB97C \uBAA8\uB450 \uC54C\uC218\uB294 \uC5C6\uC796\uC544\uC694",
