  "text" : "\uC800\uB294 \uB300\uCCB4\uB85C \uD14C\uC2A4\uD305\uC744 \uC5B4\uB5BB\uAC8C \uD558\uB290\uB0D0\uC5D0 \uB300\uD55C \uC598\uAE30\uBCF4\uB2E4\uB294 \uD14C\uC2A4\uD305\uC744 \uC65C \uD574\uC57C\uD558\uB294\uB0D0\uC5D0 \uC880 \uB354 \uD2B9\uD654\uB41C \uC0AC\uB78C\uC785\uB2C8\uB2E4. \uC815\uCC45 \uBC0F \uC804\uB7B5\/\uC804\uC220 \uAC1C\uBC1C, \uD504\uB85C\uC138\uC2A4 \uAD6C\uCD95 \uB4F1\uC774 \uC81C\uAC00 \uC9D1\uC911\uD558\uB294 \uBD84\uC57C\uC785\uB2C8\uB2E4. \uAD00\uB828\uD574\uC11C \uAD81\uAE08\uD558\uC2E0 \uBD84\uC774 \uACC4\uC2DC\uBA74 \uC5B8\uC81C\uB4E0\uC9C0 \uC9C8\uBB38\uACFC \uD1A0\uB860\uC740 \uD658\uC601\uD569\uB2C8\uB2E4.",
