  "id_str" : "10606906966",
  "text" : "\uAD6D\uC81C\uC801\uC778 \uAE30\uC5C5\uD658\uACBD\uC5D0\uC11C \uAC00\uC7A5 \uAC15\uB825\uD55C \uD798\uC740 \uD45C\uC900\uD654\uB2E4. \uD45C\uC900\uD654\uC758 \uADFC\uAC04\uC740 \uC624\uD508\uC774\uB2E4. \uC804\uC138\uACC4 IT \uAE30\uC220\uC744 \uC774\uB044\uB294 \uB9CE\uC740 \uAE30\uC5C5\uC740 \uAC01\uC790\uC758 \uD50C\uB7AB\uD3FC\uC744 \uAC1C\uBC29\uD568\uC73C\uB85C\uC368 \uD45C\uC900\uC744 \uC774\uB04C\uACE0 \uADF8 \uD45C\uC900\uC744 \uAE30\uBC18\uC73C\uB85C \uC138\uACC4\uB97C \uC9C0\uBC30\uD55C\uB2E4.",
