  "id_str" : "10606933780",
  "text" : "\uC6B0\uB9AC\uC758 \uAE30\uC5C5\uB4E4\uC774 \uC790\uC0AC\uC758 \uAE30\uC220\uC5D0 \uB300\uD574 \uD3D0\uC1C4\uC801\uC778 \uC785\uC7A5\uC744 \uACAC\uC9C0\uD558\uB294 \uD55C \uD55C\uAD6D\uC758 IT \uAE30\uC220\uC740 \uC544\uBB34\uB9AC \uC88B\uC740 \uAE30\uC220\uC774\uB77C\uACE0 \uD574\uB3C4 \uD587\uBE5B \uD55C\uBC88 \uBCF4\uC9C0 \uBABB\uD558\uACE0 \uC0AC\uB77C\uC9C8 \uC218\uBC16\uC5D0 \uC5C6\uB2E4. \uC0BC\uC131\uC758 8\uBC00\uB9AC \uBE44\uB514\uC624 \uD14C\uC774\uD504\uAC00 \uADF8\uB7AC\uACE0, \uC640\uC774\uBE0C\uB85C\uAC00 \uADF8\uB807\uB2E4.",
