  "text" : "\uD2B8\uC704\uD130\uC758 \uC560\uB2C8\uC6E8\uC774\uAC00 \uBB34\uC11C\uC6B4 \uC774\uC720\uB294 \uBC14\uB85C \uAC1C\uBC29\uC744 \uD1B5\uD574 SNS \uD50C\uB7AB\uD3FC \uC790\uCCB4\uB97C \uD2B8\uC704\uD130 \uD50C\uB7AB\uD3FC \uC790\uCCB4\uB85C \uB514\uD30C\uD1A0 \uD45C\uC900\uC744 \uC774\uB8F0\uC218\uB9CC \uC788\uB2E4\uBA74 \uD398\uC774\uC2A4\uBD81\uB3C4 \uAD6C\uAE00\uB3C4 \uBB34\uC12D\uC9C0 \uC54A\uC744 \uAC83\uC774\uAE30 \uB54C\uBB38\uC774\uB2E4. \uD398\uC774\uC2A4\uBD81\uB3C4 \uAD6C\uAE00\uB3C4 \uAC19\uC740 \uC804\uB7B5\uC73C\uB85C \uAC01\uC790\uC758 \uC138\uB825\uC744 \uB113\uD788\uACE0 \uC788\uB2E4. \uC6B0\uB9AC\uB294?",
