  "id_str" : "10607016604",
  "text" : "\uD45C\uC900\uD654\uC758 \uB4A4\uC5D0\uB294 \uACFC\uD559\uD654\uAC00 \uB4B7\uBC1B\uCE68 \uB418\uC5B4\uC8FC\uC5B4\uC57C \uD558\uACE0 \uADF8 \uB4A4\uC5D0\uB294 \uC804\uBB38\uD654\uB41C \uBD84\uC5C5\uD654\uAC00 \uB4B7\uBC1B\uCE68\uB418\uC5B4\uC8FC\uC5B4\uC57C \uD55C\uB2E4. \uD558\uC9C0\uB9CC \uC6B0\uB9AC\uB294 \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uAC1C\uBC1C\uC5D0\uC11C \uC778\uC0AC, \uC7AC\uBB34, \uAD00\uB9AC, \uD14C\uC2A4\uD305 \uC5B4\uB290\uAC83 \uD558\uB098 \uACFC\uD559\uC801\uC73C\uB85C \uC804\uBB38\uD654\uB41C \uBD84\uC57C\uAC00 \uC5C6\uC774 \uBAA8\uB450 \uACBD\uB825\uC9C1\uC73C\uB85C\uB9CC \uBF51\uB294\uB2E4.",
