  "id_str" : "10607047580",
  "text" : "\uACBD\uB825\uACFC \uACFC\uD559\uD654\uB294 \uC544\uBB34\uB7F0 \uAD00\uB828\uC774 \uC5C6\uB2E4\uACE0 \uBD10\uB3C4 \uBB34\uBC29\uD558\uB2E4. \uACFC\uD559\uD654\uB294 \uB370\uC774\uD130\uC5D0 \uAE30\uBC18\uD574\uC57C\uD558\uACE0 \uADF8 \uB4A4\uC5D0\uB294 \uD6C8\uB828\uB41C \uC0AC\uB78C\uC774 \uC788\uC5B4\uC57C \uD558\uACE0 \uADF8 \uB4A4\uC5D0\uB294 \uAD50\uC721\uC5D0 \uB300\uD55C \uAFB8\uC900\uD55C \uD22C\uC790\uAC00 \uC788\uC5B4\uC57C \uD55C\uB2E4.",
