  "id_str" : "10607077654",
  "text" : "\uD558\uC9C0\uB9CC \uB09C \uC544\uC9C0\uAE4C\uC9C0 \uB9CE\uC740 \uAE30\uC5C5\uC5D0\uC11C \uD14C\uC2A4\uD305\uC5D0 \uB300\uD558\uC5EC \uAFB8\uC900\uD55C \uAD50\uC721 \uD22C\uC790\uB97C \uD558\uB294 \uACBD\uC6B0\uB97C \uB9CE\uC774 \uBCF4\uC9C0 \uBABB\uD588\uB2E4. \uC989, \uC6B0\uB9AC \uB098\uB77C\uC758 \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uC0B0\uC5C5\uC774 \uC120\uC9C4\uAD6D\uC5D0 \uBE44\uD574 20\uB144 \uC774\uC0C1 \uB4A4\uCCD0\uC9C4 \uC774\uC720\uC640 \uAD6D\uC81C\uC801 \uACBD\uC7C1\uB825\uC774 \uC5C6\uB294 \uC774\uC720\uB294 \uC790\uBA85\uD55C \uC77C\uC774\uB2E4.",
