  "geo" : { },
  "id_str" : "10607112745",
  "text" : "\uD55C\uAD6D\uC740 \uB108\uBB34 \uACB0\uACFC\uB9CC\uC744 \uC911\uC694\uC2DC\uD55C\uB2E4. \uACB0\uACFC\uB97C \uC911\uC694\uC2DC\uD558\uB2E4 \uBCF4\uB2C8 \uBC41\uC0C8\uAC00 \uD669\uC0C8 \uCAD3\uC544\uAC00\uB2E4 \uAC00\uB791\uC9C0 \uCC22\uC5B4\uC838 \uB488\uC9C0\uB294 \uD615\uAD6D\uC774\uB2E4. \uC0DD\uC0B0\uC131 \uC99D\uB300, \uACBD\uC601 \uD601\uC2E0, \uAE30\uC220\uC758 \uC9C4\uBCF4\uB294 \uADF8\uB807\uAC8C \uD55C\uC21C\uAC04\uC5D0 \uC774\uB8E8\uC5B4\uC9C0\uC9C0 \uC54A\uB294\uB2E4. \uBAA8\uB4E0 \uAC83\uC740 \uC808\uCC28\uAC00 \uD544\uC694\uD558\uB2E4.",
