  "id_str" : "10607144176",
  "text" : "\uC808\uCC28\uC5D0 \uB300\uD55C \uC77C\uB9D0\uC758 \uACE0\uBBFC \uC5C6\uC774 \uACB0\uB860\uC5D0 \uC9D1\uCC29\uD558\uAC8C \uB41C\uB2E4\uBA74 \uAC00\uC7A5 \uC911\uC694\uD55C \uAE30\uCD08\uACF5\uC0AC \uBD80\uC2E4\uB85C \uAC89\uC73C\uB85C \uBCF4\uAE30\uC5D0\uB294 \uBA4B\uC838 \uBCF4\uC774\uC9C0\uB9CC \uC678\uBD80\uC758 \uCDA9\uACA9\uC5D0 \uACB0\uCF54 \uBC84\uD2F0\uC9C0 \uBABB\uD558\uB294 \uBAA8\uB798\uC131\uC774\uB098 \uB2E4\uB97C\uBC14 \uC5C6\uB2E4. \uC9C0\uAE08\uC774\uB77C\uB3C4 \uC6B0\uB9AC\uB294 \uACFC\uC815\uC744 \uC911\uC694\uC2DC \uD560 \uD544\uC694\uAC00 \uC788\uB2E4.",
