  "geo" : { },
  "id_str" : "10607172625",
  "text" : "\uC678\uAD6D\uC758 \uC120\uC9C4 \uAE30\uC220, \uC120\uC9C4 \uAE30\uBC95\uB3C4 \uC88B\uC9C0\uB9CC \uADF8\uB7EC\uD55C \uAC83\uC774 \uC644\uC131\uB420 \uC218 \uC788\uC5C8\uB358 \uD1A0\uB300\uBD80\uD130 \uCC28\uADFC\uD788 \uB530\uB77C\uAC00\uC9C0 \uBABB\uD55C\uB2E4\uBA74 \uC218\uCC9C\uB144\uC774 \uC9C0\uB098\uB3C4 \uC6B0\uB9AC\uB294 \uC120\uC9C4\uAD6D\uC774 \uB420 \uC218 \uC5C6\uB2E4. \uCD5C\uC2E0\uC774 \uBB34\uC870\uAC74 \uC88B\uC740 \uAC83\uC740 \uC544\uB2C8\uB2E4. \uC911\uC694\uD55C \uAC83\uC740 \uC790\uC2E0\uC758 \uBD84\uC218\uC640 \uC8FC\uC81C\uC5D0 \uB9DE\uAC8C \uCD5C\uC120\uC744 \uB2E4\uD558\uB294 \uAC83\uC774\uB2E4.",
