  "text" : "\uB9CE\uC740 \uC911\uC18C\uAE30\uC5C5\uB4E4\uC774 \uC81C\uB300\uB85C \uB41C \uD14C\uC2A4\uD305\uC744 \uC218\uD589\uD558\uC9C0 \uBABB\uD558\uB294 \uAC83\uC740 \uC77C\uBD80 \uB300\uAE30\uC5C5\uC774\uB098 \uC120\uC9C4 \uAE30\uC5C5\uB4E4\uC5D0\uC11C\uB098 \uAC00\uB2A5\uD55C\uAC83\uB9CC\uC744 \uC0DD\uAC01\uD558\uAE30 \uB54C\uBB38\uC774\uB2E4. \uADF8\uB7F0\uAC74 \uB098\uC911\uC5D0 \uC0DD\uAC01\uD558\uACE0 \uC6B0\uC120 \uAC00\uC7A5 \uC911\uC694\uD558\uACE0 \uC2DC\uAE09\uD55C \uAC83\uBD80\uD130 \uCC28\uADFC \uCC28\uADFC \uD574\uB098\uAC08 \uD544\uC694\uAC00 \uC788\uB2E4.",
