  "id_str" : "10607251836",
  "text" : "\uB09C SW Testing Camp\uB97C \uD1B5\uD574\uC11C \uB9CE\uC740 \uC0AC\uB78C\uB4E4\uC774 \uC9C0\uAE08 \uB2F9\uC7A5 \uD544\uC694\uD55C \uAC83\uB4E4\uC5D0 \uB300\uD574 \uB9CE\uC740 \uC774\uC57C\uAE30\uB97C \uB098\uB20C \uC218 \uC788\uC5C8\uC73C\uBA74 \uC88B\uACA0\uB2E4. \uD14C\uC2A4\uD2B8 \uC790\uB3D9\uD654, \uC815\uCC45 \uBC0F \uC804\uB7B5, \uD504\uB85C\uC138\uC2A4, \uD45C\uC900 \uADF8\uB7F0\uAC78 \uB2E4 \uB5A0\uB098\uC11C \uC9C0\uAE08 \uB2F9\uC7A5 \uD560 \uC218 \uC788\uB294 \uAC83\uC5D0 \uB354 \uC9D1\uC911\uD560 \uC218 \uC788\uC5C8\uC73C\uBA74 \uD55C\uB2E4.",
