  "text" : "\uC804\uBB38\uAC00\uB780 \uC5B4\uB5A4 \uC0AC\uB78C\uC77C\uAE4C? \uB0B4\uAC00 \uC0DD\uAC01\uD558\uAE30\uC5D0 \uBB34\uC5B8\uAC00\uB97C \uB0A8\uB4E4\uBCF4\uB2E4 \uC798\uD558\uACE0 \uB9CE\uC774 \uC548\uB2E4\uACE0 \uC804\uBB38\uAC00\uB294 \uC544\uB2CC \uAC70 \uAC19\uB2E4. \uC798 \uC544\uB294 \uAC83\uC744 \uB118\uC5B4 \uC0C8\uB85C\uC6B4 \uAC83\uC744 \uB9CC\uB4E4\uC5B4 \uB0BC \uC218 \uC788\uC5B4\uC57C \uC804\uBB38\uAC00\uAC00 \uC544\uB2D0\uAE4C? \uADF8\uB7F0\uBA74\uC5D0\uC11C \uB09C \uC544\uC9C1 \uD55C\uCC38 \uBA40\uC5C8\uB2E4.",
