  "text" : "\uC9C0\uAE08\uAE4C\uC9C0 \uBE44\uC6A9 \uC808\uAC10\uC744 \uC774\uC720\uB85C \uD5C8\uB9AC\uB760\uB97C \uC878\uB77C\uB9E8 \uC774\uD6C4\uC5D0 \uC81C\uB300\uB85C \uC131\uACF5\uD55C \uAE30\uC5C5\uC740 \uAC70\uC758 \uC5C6\uB2E4. \uBB3C\uB860 \uC704\uAE30\uB97C \uADF9\uBCF5\uD55C \uAE30\uC5C5\uB3C4 \uC788\uC9C0\uB9CC \uBA87\uB144 \uB4A4\uBA74 \uB610\uB2E4\uC2DC \uC7AC\uD0D5\uC774\uB2E4. \uC131\uC7A5 \uB3D9\uB825\uC744 \uC783\uC9C0 \uC54A\uAE30 \uC704\uD574 \uB178\uB825\uC744 \uD574\uC57C \uD55C\uB2E4.",
