  "text" : "\uD1A0\uC694\uD0C0\uAC00 \uAE30\uC874\uC5D0 \uAD6C\uCD95\uD588\uB358 \uC774\uBBF8\uC9C0\uB97C \uBC84\uB9AC\uACE0 \uBE44\uC6A9 \uC808\uAC10\uC744 \uBAA8\uD1A0\uB85C \uC0BC\uC558\uB358 \uADF8 \uB54C\uAC00 \uC0AC\uC2E4\uC740 \uC9C0\uAE08\uC758 \uB3C4\uC694\uD0C0\uC758 \uBAB0\uB77D\uC744 \uAC00\uC838\uC654\uB358 \uD0A4\uAC00 \uB418\uC5C8\uC744 \uAC83\uC774\uB2E4. \uBE44\uC6A9 \uC808\uAC10\uC740 \uB2F9\uC7A5\uC740 \uC774\uC775\uC77C\uC9C0 \uBAA8\uB974\uC9C0\uB9CC \uD68C\uC0DD\uC758 \uAE38\uC5D0\uC11C \uBA40\uC5B4\uC9C0\uB294 \uC9C0\uB984\uAE38\uC774 \uB41C\uB2E4.",
