  "text" : "\uC0AC\uB78C\uC740 \uC790\uC6D0\uC774 \uC544\uB2C8\uB2E4. \uBE44\uC6A9\uC808\uAC10, \uAE34\uCD95\uC7AC\uC815 \uB4F1 \uC5EC\uB7EC \uC774\uC720\uB85C \uC0AC\uB78C\uC5D0 \uC190\uC744 \uB300\uAE30 \uC2DC\uC791\uD558\uBA74 \uADF8 \uAE30\uC5C5\uC758 \uC131\uC7A5 \uB3D9\uB825\uC740 \uD68C\uBCF5 \uBD88\uB2A5\uC5D0 \uBE60\uC838\uBC84\uB9B0\uB2E4. \uC0AC\uB78C\uC740 \uD560\uC77C\uC5C6\uC774 \uB4B9\uAD6C\uB294 \uC0AC\uB78C\uC77C\uC9C0\uB77C\uB3C4 \uADC0\uC911\uD55C \uC131\uC7A5 \uB3D9\uB825\uC774 \uB420 \uC7A0\uC7AC\uB825\uC744 \uAC00\uC9C0\uACE0 \uC788\uB294 \uAC83\uC774\uB2E4.",
