  "text" : "\uC18C\uD504\uD2B8\uC6E8\uC5B4 \uC815\uCC45, \uAD50\uC721 \uB4F1 \uB9CE\uC740 \uBD80\uBD84\uC5D0\uC11C \uAC1C\uBC1C, \uAE30\uD68D, \uC124\uACC4 \uB4F1\uC740 \uB9CE\uC740 \uB17C\uC758\uAC00 \uC774\uB8E8\uC5B4\uC9C0\uC9C0\uB9CC \uB9C9\uC0C1 \uB9CC\uB4E4\uC5B4\uC9C4 \uAC83\uC744 \uC5B4\uB5BB\uAC8C \uAC80\uC99D\uD558\uACE0 \uC5B4\uB5BB\uAC8C \uAC1C\uC120\uC2DC\uD0AC\uAC83\uC778\uC9C0\uC5D0 \uB300\uD574\uC11C\uB294 \uB17C\uC758\uAC00 \uB9CE\uC9C0 \uC54A\uB2E4. \uD14C\uC2A4\uD2B8\uB97C \uB4F1\uD55C\uC2DC \uD558\uB294 \uD55C \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uAC15\uAD6D\uC740 \uB0A8\uC758 \uB098\uB77C \uC77C\uC774\uB2E4.",
