  "text" : "\uC8FC\uBCC0\uC5D0 \uB098\uB294 \uAE30\uB3C5\uAD50\uC778\uC774\uB2E4 \uB77C\uACE0 \uB5A0\uBC8C\uB9AC\uACE0 \uB2E4\uB2C8\uB294 \uC0AC\uB78C \uCE58\uACE0 \uC81C\uB300\uB85C \uB41C \uAE30\uB3C5\uAD50\uC778 \uBABB\uBD24\uC2B5\uB2C8\uB2E4. YS\uAC00 \uADF8\uB807\uACE0 MB\uAC00 \uADF8\uB807\uC838.. \uAD50\uD68C\uC758 \uD48D\uBD80\uD55C \uC778\uC801 \uBB3C\uC801 \uC790\uC6D0\uC744 \uBE68\uC544\uB4E4\uC5EC \uC790\uC2E0\uC758 \uAE30\uBC18\uC744 \uB2E6\uB294\uB370 \uC774\uC6A9\uD558\uB294 \uBB34\uB2AC\uB9CC \uAE30\uB3C5\uAD50\uC778\uC774 \uBB34\uCC99 \uB9CE\uC2B5\uB2C8\uB2E4.",
